import React from 'react';
import "./css/style.css"

const Weather = ()=>{
    return(
        <>
        <div className="box">
            <div className="inputData">
                <input
                type="search"
                className="inputField"
                onChange = {
                     (event) => {

                     }
                }
                />
            </div>
        </div>
        <div className="info">
                <h2 className="location">
                    <i class="fas fa-street-view"></i>
                </h2>
                <h1 className="temp"> 
                    5.25 cel
                </h1>
                <h3 className="tempmin_,max">
                    min: 10 max:50
                </h3>
        </div>
        </>
    )
}

export default Weather;
